import React from 'react'
import styled from 'styled-components';
import img from '../images/Experience_background.png'
import HomeButton from '../subComponents/HomeButton';
import LogoComponent from '../subComponents/LogoComponent';

const MainContainer = styled.div`
  /*  background-image: url(${img});
    background-size:cover;
    background-repeat:no-repeat;
    background-attachement:fixed;
    background-position:center;
    opacity:0.4;*/

    wdith:100vw;
    height:100vh;
    background: rgb(0,140,179);
    background: linear-gradient(90deg, rgba(0,140,179,1) 0%, rgba(2,178,226,1) 46%, rgba(0,212,255,1) 100%);
`
const Container = styled.div`
    background-color : ${props=>`rgba(${props.theme.bodyRba},0,0)`};
    width:100%;
    height:auto;
    position:relative;
    padding-bottom: 5rem;

`

function MyExperiencePage() {
    return (
        <MainContainer>
            <Container>
                <LogoComponent/>
                <HomeButton />
            </Container>
        </MainContainer>
    );
}

export default MyExperiencePage
